import AuthHeader from "./AuthHeader";
import HelperService from "./HelperService";

const API_USER_URL = "http://localhost:8080/test";

const getAllUsers = () => {
  let data = HelperService.makeAPICall(
    API_USER_URL + "/USER",
    "GET",
    AuthHeader.authHeader(),
    null
  );
  console.log(data);
  return data;
};

const UserService = {
  getAllUsers,
};

export default UserService;
